quoteText:
And so you are resolved to be my travelling companion this morning;
eh? Why, you are not in the same mind or intention two
half-hours together!

There ain't, there ain't a stauncher-hearted gal going, or I'd
have cut her throat three months ago. She's got the fever coming on;
that's it.
